import React, { useEffect, useState } from "react";
import {
  Paper,
  TableContainer,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  Box,
  Grid,
} from "@material-ui/core";
import {
  Chart,
  LineSeries,
  ScatterSeries,
} from "@devexpress/dx-react-chart-material-ui";
import useStyle from "./styles";

interface Column {
  id: "cve" | "date" | "severity" | "desc";
  label: string;
  minWidth?: number;
  align?: "left";
}
const columns: Column[] = [
  { id: "cve", label: "CVE ID", minWidth: 170 },
  { id: "date", label: "PUBLISHED DATE", minWidth: 170 },
  { id: "severity", label: "SEVERITY", minWidth: 170 },
  { id: "desc", label: "DESCRIPTION", minWidth: 170 },
];

const Dashboard = () => {
  const classes = useStyle();
  const [data, setData] = useState<any[]>([]);

  //const item = { cve: { CVE_data_meta: { ID: "number" }, description: { description_data: { value: "string" }}},  severity: "string" , publishedDate: "number"}

  useEffect(() => {
    fetch("http://localhost:5000/data")
      .then((response) => response.json())
      .then((resData) => setData(resData.data));
  }, []);

  console.log(data);

  // console.log(data)
  return (
    <Grid className={classes.box}>
      <Paper className={classes.root}>
        <TableContainer className={classes.container}>
          <Table stickyHeader aria-label="sticky table">
            <TableHead>
              <TableRow>
                {columns.map((column) => (
                  <TableCell
                    key={column.id}
                    align={column.align}
                    style={{ minWidth: column.minWidth }}
                  >
                    {column.label}
                  </TableCell>
                ))}
              </TableRow>
            </TableHead>
            <TableBody>
              {data.map((item) => (
                <TableRow>
                  <TableCell
                    key={item.id}
                    align={item.align}
                    style={{ minWidth: item.minWidth }}
                  >
                    {" "}
                    {item.cve.CVE_data_meta.ID}{" "}
                  </TableCell>
                  <TableCell
                    key={item.id}
                    align={item.align}
                    style={{ minWidth: item.minWidth }}
                  >
                    {" "}
                    {item.publishedDate}{" "}
                  </TableCell>
                  <TableCell
                    key={item.id}
                    align={item.align}
                    style={{ minWidth: item.minWidth }}
                  >
                    {" "}
                    {item.impact.severity}{" "}
                  </TableCell>
                  <TableCell
                    key={item.id}
                    align={item.align}
                    style={{ minWidth: item.minWidth }}
                  >
                    {" "}
                    {item.cve.description.description_data.value}{" "}
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
        <Grid className={classes.chart}>
          {data.map((item) => (
            <Chart>hola</Chart>
          ))}
        </Grid>
      </Paper>
    </Grid>
  );
};

export default Dashboard;
